import insta2 from "../fotos/logos/insta2.svg"
import optimizarlogo from "../fotos/logos/opti"

const productos = [
    {
        "id":0,
        "img": filmsilver

    },
    {
        "id":1,
        "img": logoInst
    },
    {
    "id":2,
    "img": logolensun
    },
    {
